import React from 'react';
import {
  Card, CardContent, CardMedia, Typography, Box, Chip, Rating,
  IconButton, CardActions, Button
} from '@mui/material';
import { styled } from '@mui/material/styles';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import FavoriteIcon from '@mui/icons-material/Favorite';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import PropTypes from 'prop-types';

const StyledCard = styled(Card)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  height: '100%',
  transition: 'transform 0.2s ease-in-out, box-shadow 0.2s ease-in-out',
  '&:hover': {
    transform: 'translateY(-4px)',
    boxShadow: theme.shadows[6],
  },
}));

const RestaurantCard = ({ restaurant, onRestaurantSelect }) => {
  const [favorite, setFavorite] = React.useState(false);

  const toggleFavorite = (e) => {
    e.stopPropagation();
    setFavorite(!favorite);
  };

  const formatPrice = (priceRange) => {
    return Array(priceRange).fill('$').join('');
  };

  const truncateText = (text, maxLength) => {
    if (!text) return '';
    return text.length > maxLength ? `${text.substring(0, maxLength)}...` : text;
  };

  return (
    <StyledCard onClick={() => onRestaurantSelect(restaurant)}>
      <Box sx={{ position: 'relative' }}>
        <CardMedia
          component="img"
          height="160"
          image={restaurant.image || 'https://via.placeholder.com/300x160?text=No+Image'}
          alt={restaurant.name}
        />
        <Box
          sx={{
            position: 'absolute',
            top: 8,
            right: 8,
            bgcolor: 'rgba(255, 255, 255, 0.8)',
            borderRadius: '50%',
            width: 36,
            height: 36,
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
          }}
        >
          <IconButton size="small" onClick={toggleFavorite} color="primary">
            {favorite ? <FavoriteIcon color="error" /> : <FavoriteBorderIcon />}
          </IconButton>
        </Box>
      </Box>
      <CardContent sx={{ flexGrow: 1 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
          <Typography variant="h6" component="div" gutterBottom noWrap sx={{ maxWidth: '80%' }}>
            {restaurant.name}
          </Typography>
          <Chip
            size="small"
            label={formatPrice(restaurant.priceRange)}
            sx={{ height: 24, minWidth: 45 }}
          />
        </Box>

        <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
          <Rating
            value={restaurant.rating}
            precision={0.5}
            size="small"
            readOnly
          />
          <Typography variant="body2" color="text.secondary" sx={{ ml: 0.5 }}>
            ({restaurant.rating})
          </Typography>
        </Box>

        <Typography variant="body2" color="text.secondary" gutterBottom>
          {restaurant.cuisine}
        </Typography>

        <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
          <LocationOnIcon fontSize="inherit" sx={{ verticalAlign: 'text-bottom', mr: 0.5 }} />
          {truncateText(restaurant.address, 35)}
        </Typography>

        {restaurant.description && (
          <Typography variant="body2" color="text.secondary">
            {truncateText(restaurant.description, 75)}
          </Typography>
        )}
      </CardContent>
      <CardActions sx={{ justifyContent: 'space-between', p: 2, pt: 0 }}>
        <Button size="small" color="primary">
          View Details
        </Button>
      </CardActions>
    </StyledCard>
  );
};

RestaurantCard.propTypes = {
  restaurant: PropTypes.shape({
    id: PropTypes.oneOfType([PropTypes.string, PropTypes.number]).isRequired,
    name: PropTypes.string.isRequired,
    cuisine: PropTypes.string.isRequired,
    address: PropTypes.string.isRequired,
    rating: PropTypes.number.isRequired,
    priceRange: PropTypes.number.isRequired,
    location: PropTypes.shape({
      lat: PropTypes.number.isRequired,
      lng: PropTypes.number.isRequired
    }).isRequired,
    image: PropTypes.string,
    description: PropTypes.string,
  }).isRequired,
  onRestaurantSelect: PropTypes.func.isRequired
};

export default RestaurantCard;
